import React from 'react'
import {Container,Header,Icon} from 'semantic-ui-react'
import './App.css'

const Headers = ()=>{
    return(
    <Container className='margins'>
    <Header block>
        <span><Icon name='shop'/></span><span className='centered'>harry and ellie</span>
    </Header>
    </Container>
    )
}

export default Headers
